import { ADD_ARTICLE, DATA_REQUESTED, USER_DATA_REQUESTED, AUTH_STATE } from "../constants/action-types";

export function addArticle(payload) {
    return { type: ADD_ARTICLE, payload: "test" }
}

export function getData() {
    return { type: DATA_REQUESTED };
}

export function getCurrentUser() {
    return { type: USER_DATA_REQUESTED };
}

export function setAuthState(payload) {
    return { type: AUTH_STATE, payload: payload }
}
